import React from 'react';
import {StyleSheet} from 'react-native';
const styles = StyleSheet.create({
  interface:{
    backgroundColor: '#82d3ff',
    color:'#fff',
    alignItems: 'center',
    alignSelf: 'stretch',
    justifyContent:'center',
    paddingTop:35,
  },
  interfaceText:{
    fontSize:24,
    color:'#850d6b'
  },
    container: {
      flex: 3,
      backgroundColor: '#82d3ff',
      alignItems: 'center',
      //justifyContent: 'center',
      paddingTop:30,
      //margin: 5,
      //width: 250, 
      //alignSelf: 'center'
      borderTopWidth:2,
      borderColor:'#ffffff'
    },
    separator: {
      marginVertical: 8,
      borderBottomColor: '#737373',
      borderBottomWidth: StyleSheet.hairlineWidth,
    },
    title: {
      textAlign: 'center',
      marginVertical: 8,
    },
    textinput:{
      alignSelf:'stretch',
      height: 40,
      width: 350,
      //marginBottom:30,
      marginLeft:50,
      color:'#fff',
      borderBottomColor:'#f8f8f8',
      borderBottomWidth:1,
      justifyContent: 'center',
      alignItems: 'center',
    },
    registerButton:{
      alignSelf:'stretch',
      alignItems:'center',
      padding: 15,
      backgroundColor:'#6498b5',
      width: 100,
      marginLeft:50,
      
    },
    registerbtntxt:{
      color:'#fff',
      fontWeight:'bold'
    }
  });

  export {styles}
